<ウェザーニュースより台風10号情報>﻿
﻿
台風10号　過去最強クラスで接近　経験のないような荒天に最大限の警戒﻿
﻿
今後も発達を続けて、猛烈な勢力となる予想です。今夜には最大瞬間風速80m/sで南大東島近海を通過し、勢力を保ったまま6日(日)には奄美諸島近海を通過する見解となっています。台風の進路に近い島々では、過去に経験のないような荒天となるおそれがあり、最大限の警戒が必要です。﻿
﻿
九州に接近する6日(日)夜から7日(月)朝にかけても、中心付近の最大瞬間風速は60～75m/s程度と見られ、勢力は過去最強クラス。特別警報の発表基準に達するほどです。これだけの勢力で近づけば上陸しなくても、甚大な被害につながる危険性が高まります。最悪の事態に備え、九州では出来るだけ今日ののうちに台風への備えや避難などを行うようにしてください。﻿
﻿
▼台風10号　9月5日(土)3時﻿
　存在地域　　　南大東島の南南東 約320km﻿
　大きさ階級　　／／﻿
　強さ階級　　　非常に強い﻿
　移動　　　　　西北西　15 km/h﻿
　中心気圧　　　920 hPa﻿
　最大風速　　　50 m/s (中心付近)﻿
　最大瞬間風速　70 m/s﻿
﻿
九州など記録的な暴風で停電リスク高い﻿
﻿
強い吹き寄せ効果で記録的な高潮のおそれも﻿
﻿
九州から東海の広範囲で大雨のおそれ﻿
﻿
沖縄や奄美では、段々と荒れた天気となってくるため、可能な限り早めに対策を行ってください。九州でも、今日のうちに備えを済ませるようにしてください。🍃🌀🍃🍃🌀🍃🍃🌀🍃﻿
